import React from "react";
import { data } from "../../../data";

const UseStateArray = () => {
  const [people, setPeople] = React.useState(data);
  console.log(people);
  return (
    <>
      {people.map(({id, name}) => {
        return (
          <div>
            <h4 key={id}>{name}</h4>

          </div>
          )
      })}
    </>
  )
};

export default UseStateArray;
